import React from 'react';
import { Fragment } from 'react'
import ReactDOM from 'react-dom';
import './index.css';






const App = () => {
    return (
        <div className='container'>
            <Fragment>
                <h1>Hello word</h1>
            </Fragment>
        </div>

    );
};



ReactDOM.render(<App />, document.getElementById('root'));
